import React, { Component } from 'react'
import logo from"../logo.svg"
import {Link} from "react-router-dom"
export default class  extends Component {
    render() {
        return (
           <nav className="nav-wrapper blue">
               {/*
            https://www.iconfinder.com/icons/1243689/call_phone_icon Creative Commons (Attribution 3.0 Unported);
            https://www.iconfinder.com/Makoto_msk */}
    <Link to="/"><img src={logo} alt="logo" className="brand-logo left"></img></Link>
    <ul id="nav-mobile" className="center hide-on-med-and-down">
    <li className="">
        <Link to="/" className="align-center">Products</Link>
    </li>
</ul>
        <Link to="/cart" className="right"><button className="btn"><i className="fas fa-cart-plus"></i>
        My Cart</button></Link>

           </nav>
        )
    }
}
